import React from "react";

import * as S from "./styles";

const Main = ({
  title = "React Avançado",
  description = "Typescript, ReactJS, NextJS e Styled Components",
}) => {
  return (
    <S.Container>
      <S.Title>{title}</S.Title>
    </S.Container>
  );
};

export default Main;
